import React, {  } from 'react';
// import { useTheme } from "@mui/material/styles";
import {

  Button,
} from "@mui/material";


const SellerListTools = ({ setpdf, volv, setboton, setescondidoinicial }) => {

	// const theme = useTheme();

	const research = () => {
		setescondidoinicial({
			escondidoinicial: false
		});

		setboton({
			volver: false
		});
	};

	const volver = () => {
		setescondidoinicial({
			escondidoinicial: true
		});

		setboton({
			volver: true
		});

		setpdf({
			loading: true
		});
	};

	return (
		<>
			{volv ? (
				<Button  variant="contained" color="secondary">
					+ New Search
				</Button>
			) : null}
			{volv ? null : (
				<Button  variant="contained" color="secondary">
					Back to List
				</Button>
			)}
		</>
	);
};

export default SellerListTools;
